import React from 'react'

export default function Input({type, alt, checked, maxlength, placeholder, value}) {
    return (
    <input 
    type={type}
    alt={alt} 
    check={checked} 
    maxLength={maxlength} 
    placeholder={placeholder} 
    value={value}>
    </input>
    )
}
